/**
 * @suppress
 */
public object FfiConverterTypeClient : FfiConverter<Client, Pointer> {
    override fun lower(value: Client): Pointer = value.uniffiClonePointer()

    override fun lift(value: Pointer): Client = Client(value)

    override fun read(buf: ByteBuffer): Client {
        // The Rust code always writes pointers as 8 bytes, and will
        // fail to compile if they don't fit.
        return lift(Pointer(buf.getLong()))
    }

    override fun allocationSize(value: Client) = 8UL

    override fun write(
        value: Client,
        buf: ByteBuffer,
    ) {
        // The Rust code always expects pointers written as 8 bytes,
        // and will fail to compile if they don't fit.
        buf.putLong(Pointer.nativeValue(lower(value)))
    }
}

/**
 * An annotation on a sample (bounding box, mask, etc.).
 */
data class Annotation(
    /**
     * Sample this annotation belongs to.
     */
    val `sampleId`: SampleId?,
    /**
     * Image/sample name.
     */
    val `name`: kotlin.String?,
    /**
     * Sequence this annotation belongs to.
     */
    val `sequenceName`: kotlin.String?,
    /**
     * Frame number within the sequence.
     */
    val `frameNumber`: kotlin.UInt?,
    /**
     * Dataset split (train, val, test).
     */
    val `group`: kotlin.String?,
    /**
     * Object tracking identifier across frames.
     */
    val `objectId`: kotlin.String?,
    /**
     * Label/class name.
     */
    val `labelName`: kotlin.String?,
    /**
     * Label/class index.
     */
    val `labelIndex`: kotlin.ULong?,
    /**
     * 2D bounding box.
     */
    val `box2d`: Box2d?,
    /**
