/**
 * Error type for client operations.
 */
sealed class ClientException : kotlin.Exception() {
    /**
     * Authentication failed or token is invalid/expired.
     */
    class AuthenticationException(
        val `message`: kotlin.String,
    ) : ClientException() {
        override val message
            get() = "message=${ `message` }"
    }

    /**
     * Network or HTTP error.
     */
    class NetworkException(
        val `message`: kotlin.String,
    ) : ClientException() {
        override val message
            get() = "message=${ `message` }"
    }

    /**
     * Invalid parameters provided to an operation.
     */
    class InvalidParameters(
        val `message`: kotlin.String,
    ) : ClientException() {
        override val message
            get() = "message=${ `message` }"
    }

    /**
     * Requested resource was not found.
     */
    class NotFound(
        val `message`: kotlin.String,
    ) : ClientException() {
        override val message
            get() = "message=${ `message` }"
    }

    /**
     * Token storage operation failed.
     */
    class StorageException(
        val `message`: kotlin.String,
    ) : ClientException() {
        override val message
            get() = "message=${ `message` }"
    }

    /**
     * Internal error or unexpected condition.
     */
    class InternalException(
        val `message`: kotlin.String,
    ) : ClientException() {
        override val message
            get() = "message=${ `message` }"
    }

    companion object ErrorHandler : UniffiRustCallStatusErrorHandler<ClientException> {
        override fun lift(error_buf: RustBuffer.ByValue): ClientException = FfiConverterTypeClientError.lift(error_buf)
    }
}

